import styled from 'styled-components'

export const TilesContainer = styled.div`
  display: grid;
  grid-template-columns: 1fr 1fr 1fr 1fr 1fr;

  @include respond-to(480, max) {
    margin: 0 2px;
    padding: 42px 12px 52px;

    .form {
      &__row {
        margin: 0 -6px;
      }

      &__column {
        margin: 0 6px;
      }
    }
  }
`
